/* Flag set in ISR when SPI FIFO is empty */
CYBIT SPI_FIFO_Flag = 0;

/*******************************************************************************
* Function Name: isr_1
********************************************************************************
*
* Summary:
*  Sets a flag when FIFO is empty
*
* Parameters: 
* 	None
*
* Return:
*   None
*
*******************************************************************************/
CY_ISR(SPI_FIFO_EMPTY)
{
	SPI_FIFO_Flag = 1;
}

/*******************************************************************************
* Function Name: main
********************************************************************************
*
* Summary:
*  Initializes Components and plays the different arrays by calling Play_Tone
*
* Parameters: 
*	None
*
* Return:
*   None
*
*******************************************************************************/
void main()
{
	SPIM_1_Start();
	isr_1_StartEx(SPI_FIFO_EMPTY);
	
	CyGlobalIntEnable;
	
	Play_Tone((uint8 *)voice, 3830);
	CyDelay(500);
	Play_Tone((uint8 *)moo, 3311);
	CyDelay(500);
	Play_Tone((uint8 *)quack, 251);
	CyDelay(50);
	Play_Tone((uint8 *)quack, 251);
	CyDelay(250);
	Play_Tone((uint8 *)quack, 251);
	CyDelay(50);
	Play_Tone((uint8 *)quack, 251);
	CyDelay(500);
	Play_Tone((uint8 *)crowing, 2199);
	CyDelay(500);
	Play_Tone((uint8 *)bark, 1379);
	CyDelay(500);
	Play_Tone((uint8 *)bell, 1309);
	CyDelay(500);
	Play_Tone((uint8 *)boing, 828);
	
	for(;;)
    {  	
	}
}

/*******************************************************************************
* Function Name: Play_Tone
********************************************************************************
*
* Summary:
*  Blocking function that 'plays' an array by writing to the SPI
*
* Parameters: 
* 	uint8 *array: Pointer to the array containing 1-bit tune data
*	uint16 len	: Length of the array
*
* Return:
*   None
*
*******************************************************************************/
void Play_Tone(uint8 *array, uint16 len)
{
	uint16 index = 0;
	
	while(index < len)
	{
		if(SPI_FIFO_Flag)
		{
			SPIM_1_WriteTxData(array[index]);
			index++;
			SPI_FIFO_Flag = 0;
		}
	}
}

